import React from "react";
import "../styles.css";


const SignIn = () => {
  return (
    <div className="sign-in-box">
      <div className="sign-in-center">
        <p>Welcome Back!</p>

        <input type="text" className="email-input" placeholder="Email..."/>
        <input type="text" placeholder="Password..."/>
        <input type="submit" value="Sign-In"></input>
        <div>Or sign in with:</div>
        <div style={{padding: '10px'}}>
          <i className="fab fa-google social-media-icons"></i>     
          <i className="fab fa-facebook social-media-icons"></i>
          <i className="fab fa-twitter social-media-icons"></i>
          </div>
          <button style={{textAlign:'left'}}>Forgot password</button>
          <button style={{textAlign:'right'}}>sign-up</button>

       </div>


    </div>
  );
};

export default SignIn;
